ingredients_text:
Lait écrémé pasteurisé (origine : France) ; crème pasteurisée 
(origine : France) ; sucre 7,5 % ; sirop de glucose-fructose ; amidon 
modifié de maïs ; arômes naturels de vanille de Madagascar ; 
concentré des minéraux du lait ; correcteurs d'acidité : acide 
citrique, E331 ; gousses de vanille de Madagascar épuisées et broyées ; 
épaississant : gomme xanthane ; ferments lactiques. Décor : gousses de vanille de Madagascar épuisées et broyées.
